import React from 'react';
import './Menu.css';
import { useMain } from '../states/main_state'; // Adjust the path as necessary

const Menu = () => {
  const { setCurrentMain } = useMain();

  const handleButtonClick = (newMain) => {
    setCurrentMain(newMain);
  };

  return (
    <div className="menu">
      <button className="option" onClick={() => handleButtonClick('home_main')}>/Init</button>
      <button className="option" onClick={() => handleButtonClick('intro_main')}>/Intro</button>
      <button className="option" onClick={() => handleButtonClick('alfa_main')}>/Alfa</button>
      <button className="option" onClick={() => handleButtonClick('beta_main')}>/Beta</button>
    </div>
  );
};

export default Menu;
